import React from "react";
import impressionIcon from "../images/impressionIcon.png";

function TrendingQuizBox() {
  return (
    <div
      style={{
        height: "10vh",
        width: "14vw",
        backgroundColor: "white",
        marginLeft: "3vw",
        marginTop: "3vh",
        borderRadius: "5px",
        fontWeight: "600",
      }}
    >
      <p
        style={{
          color: "#474444",
          fontSize: "1.5em",
          marginTop: "0.9vh",
          marginLeft: "0.5vw",
        }}
      >
        Quiz 1
        <span
          style={{ color: "#FF5D01", marginLeft: "4vw", fontSize: "1em" }}
        >
          667
        </span>
        <img
          style={{ marginLeft: "0.3vw" ,height:"2.5vh",width:"1.3vw"}}
          src={impressionIcon}
          alt="impressionIcon"
        />
     </p>
      <p style={{ color: "#60B84B", fontSize: "1em",marginLeft:"0.2vw" }}>
        Created on : 04 Sep, 2023
      </p>
    </div>
  );
}

export default TrendingQuizBox;
